function App() {
  return (
    <div className="text-center p-10">
      <h1 className="text-4xl font-bold text-blue-600">Welcome to FocusMate</h1>
      <p className="text-lg mt-4 text-gray-600">
        Your AI-powered companion for deep focus and productivity.
      </p>
      <button className="mt-6 px-6 py-2 bg-blue-500 text-white rounded-lg hover:bg-blue-600 transition">
        Get Started
      </button>
    </div>
  );
}

export default App;
